import { useEffect, useState } from "react";
import axios from "axios";

function App() {
  const [currency, setCurrency] = useState([]);

  useEffect(() => {
    axios
      .get(
        "https://api.coingecko.com/api/v3/coins/markets?vs_currency=gbp&order=market_cap_desc&per_page=10&page=1&sparkline=false"
      )
      .then((res) => {
        setCurrency(res.data);
        console.log(res.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  return <>
  <div className="currency-app"></div>
  <div className="currency-search"></div>
  <h1>Search for currency</h1>
  </>;
}

export default App;
